ый замок", "TUSUNNY"], "63": ["Хорошее качество. Клеится отлично. Держатся прекрасно. Деткам сразу стало не интересно открывать ящики и не только )))", "2021-03-17T15:13:42Z", "белый мрамор", "0", 3, 1, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок", "TUSUNNY"], "64": ["Отличный набор, удобное крепление, открывается одной рукой. ", "2021-03-15T18:59:05Z", "белый мрамор, черный", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок", "TUSUNNY"], "65": ["Прикрепились крепко. Хороший товар.", "2021-03-15T08:52:51Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок", "TUSUNNY"], "66": ["Блокираторы крепкие, надежные, но один в партии был бракованный, отсутствовала клейкая подушечка. Двусторонний скотч не помог, а на клей клеить на мебель не хочу. Заметили, когда одна сторона была наклеена. Уважаемый продавец, как я могу получить замену? ", "2021-03-15T03:56:53Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок", "TUSUNNY"], "67": ["Очень хороший блокиратор. Держится крепко, выглядит аккуратно, взрослый откроет легко, а ребёнок 2х лет не открывает", "2021-03-14T21:48:45Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок", "TUSUNNY"], "68": ["Первый раз брала за 752, сейчас заказали еще такой же комплект за 675. Замки очень классные! Подходят под цвет мебели, взрослым удобно открывать и закрывать.  Ребенку 1,5 пока не умеет открывать сам. Держатся крепко, рекомендую!", "2021-03-12T14:23:02Z", "коричневый", "0", 5, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок", "TUSUNNY"], "69": ["Блокираторы очень хорошие, ребенок дергал, ничего не отпало, держат крепко.", "2021-03-12T11:08:42Z", "белый мрамор, черный", "0", 3, 1, 5, "Блокиратор дверей