яется на отлично.", "2020-11-21T10:41:52Z", "белый", "0", 4, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "187": ["Заказываем третий раз, очень хорошие блокираторы, т.к. перед этим эксплутировлись других производителей и более дорогих моделей, но эти оказались самые удобные и крепкие,  шкафами интересуемся с 9 мес. и любим устраивать погромы.", "2020-11-21T08:41:07Z", "белый", "0", 4, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "188": ["Конструкция простая, всё понятно,ремешок крепкий.", "2020-11-21T07:49:08Z", "белый", "0", 4, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "189": ["Реально хорошие запоры, по крайней мере от козней годовалого ребёнка. Очень долго пыталась понять как ей открыть ящики, которые ещё вчера легко отодвигались. Но секрет так и не раскрыла, после чего успокоилась\nДержат крепко, да и внешне вполне симпатичные,  рекомендую.", "2020-11-21T07:25:53Z", "белый", "0", 5, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "190": ["Прекрасные замки! Удобны в установке и использовании. Ребёнку 2 года, открыть не может. Рекомендую", "2020-11-21T07:18:45Z", "белый", "0", 4, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "191": ["Замок интересный.Дочке 2 года ,пока не посилам.", "2020-10-07T08:44:12Z", "белый", "0", 4, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "193": ["Отличные. Брала белые на шкафы и на унитазы 👍🏻 теперь коричневые заказала на кухню. Но малыш 1,5 года защелку увидел и нажимал в другую сторону и не открыл, а так бы открыл . Плохо, что при сдвиге замочка,  сразу можно открыть блок. Получается что малыш если сдвинет  как надо и сразу откроет...  А когда на шкаф приклеила и выжидала время, чтоб закрыть позже,  малыш подошёл САМ закрыл (как то..) , а открыть не смог)  но в целом прочные, мне нравятся!", "2020-11-20T19:39:01Z", "коричневый", "0", 2, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "194": ["Классные замки, даже не сразу поняла как их отстегивать))\nЛегко клеятся и очень хорошо держатся \nСоветую", "2020-11-20T16:17:08Z", "коричневый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "195": ["Отлично,  крепко", "2020-11-20T04:02:34Z", "белый", "0", 2, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "196": ["Пришли 4 блокиратора, вместо 6 !", "2020-11-18T12:49:20Z", "белый", "0", 3, 1, 1, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "197": ["Отличные,выбрали по отзывам,теперь спокойны за все шкафы,взяли сразу 2 упаковки,планируем ещё ,когда рост увеличится и ребёнок будет дотягиваться до верхних ящиков ", "2020-11-18T12:19:40Z", "белый", "0", 2, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "198": ["Блокираторы отличные, заказывала второй раз. Ребенок открыть не может. Советую к покупке!", "2020-11-18T08:12:26Z", "коричневый", "0", 2, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "199": ["Передвинула на минимальное расстояние и обратно уже сделать не получается. Дернули дверцу и шкафа и порвался ремешок.", "2020-11-16T19:55:53Z", "коричневый", "0", 0, 1, 2, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "200": ["Отличные. Правда у один в комплекте попался не рабочий.", "2020-11-16T13:19:03Z", "белый", "0", 2, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "201": ["Лучшие блокираторы из всех которые пробовала!!! Открываются легко даже ребенком 7 лет, но малышка 1 год не может открыть и отодрать липучки. Советую брать!!! Но клеить необходимо когда только появился интерес к ящикам всем, а то потом сложно истерики прекратить когда закроешь)))", "2020-11-16T11:09:09Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "202": ["Фиксаторы понравились.", "2020-11-15T22:13:19Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "203": ["Супер вещь!! До этого брали других производителей,  ребёнок либо открывал, либо отрывал. А тут чудо просто!!! Ребенок открыть не может, но очень легко взрослым открывать. ", "2020-11-14T20:07:02Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "204": ["Отличные👍 крепятся намертво просто, буду заказывать ещё!", "2020-11-14T19:42:33Z", "коричневый", "0", 4, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "205": ["Отличные блокираторы, держатся очень крепко. Ребёнку 1 годик, оторвать их не может. Открыть тоже не получается. Какое-то время проявлял интерес, а сейчас даже не подходит. ", "2020-11-14T11:57:20Z", "черный", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "206": ["Прекрасные замки! Крепятся намертво. Заказываем вторую упаковку, первую брали на пробу.\r\nВзрослым открывать легко и удобно, ребёнок ещё не понял как. Пока пытается перегрызть ремешок у замка, но безрезультатно.", "2020-11-12T04:35:39Z", "белый", "0", 5, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6