щитный замок, 6 шт.", "TUSUNNY"], "215": ["Отличные блокираторы, клеятся намертво, главное не забыть обезжирить перед приклейкой. Замок хитрый, ребенок не откроет, а взрослый легко.\r\nОбидно что после заказа через пару дней цена снизилась.", "2020-11-05T09:42:10Z", "коричневый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "216": ["Супер замочки, ребёнок не откроет. К мебели приклеиваются крепко.", "2020-11-05T09:24:26Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "217": ["Чтобы отрегулировать длину ремешка не сдвинешь регулятор, мы с мужем так и не смогли ", "2020-11-04T06:55:48Z", "черный", "0", 1, 6, 2, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "218": ["Блокираторы супер. Со своей задачей полностью справляются. Нечаянно приклеили одну штучку криво. Мужу пришлось феном греть,  чтобы отклеить. Ребенок точно не оторвет.", "2020-11-03T14:27:38Z", "коричневый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "219": ["хорошие блокираторы, пока держут очень хорошо, удобные в использовании, цена конечно \" кумается\"", "2020-11-02T17:05:59Z", "коричневый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "220": ["Пока что лучший что я видела, удобный", "2020-11-01T18:12:04Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "221": ["Отличные фиксаторы. Хорошо держаться, удобно открываются.", "2020-10-31T09:38:20Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "222": ["Хорошие блокираторы, ребёнок 1г 3 м. не может открыть. К стеклянной дверце сначала плохо приклеилось, но потом все ок.", "2020-10-31T08:48:46Z", "белый", "0", 3, 0, 5, "Блокиратор дверей, ящиков, шкафов, мебели, окон, защита от детей, детский защитный замок, 6 шт.", "TUSUNNY"], "223": ["Хорошие замки. Ребенок не отрывает, хотя постоянно дёргает за ремешки. Рекомендую.", "2020-10-30T19:35:00Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "224": ["Вроде неплохие блокираторы, крепкие. Взяла благодаря отзывам. Но пришли тоже в открытой упаковке.", "2020-10-30T19:23:31Z", "коричневый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "225": ["Блокираторы хорошие, дети их открыть не могут. Но пришли в открытой упаковке.", "2020-10-30T18:21:35Z", "черный", "0", 3, 0, 4, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "226": ["Отличные блокираторы. Не хлипкие.", "2020-10-30T16:22:38Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "227": ["Клеятся намертво. Качественные. Рекомендую.", "2020-10-29T21:08:08Z", "белый", "0", 4, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "228": ["Блокираторы понравились, отличное решение для тех, чьи дети любят вставать, держась за ручки комода. Всегда боялась, что опрокинет на себя! Замочки крепкие, держатся, открыть ребёнок не смог)) даже свекровь долго понять не могла 😁", "2020-10-29T07:11:51Z", "белый", "0", 5, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "229": ["Самые лучшие, которые были! Заказывала коричневые и сейчас наконец-то появились белые. Потому что все другие замки дочь научилась открывать и надо теперь все менять. \nСпасибо человеку, который придумал этот сложный для ребенка и легкий для родителя механизм)) домашний варвар отступил, и содержимое шкафов в безопасности!", "2020-10-28T18:31:26Z", "коричневый", "0", 6, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "230": ["Всё отлично, держит хорошо, но открывать не особо удобно. ", "2020-10-27T12:30:49Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "231": ["Пришло все в целости за два дня. Отличные блокираторы , просто маст хэв для мам. Устанавливается быстро и просто. В комплекте 6 штук и инструкция по установке и эксплуатации.", "2020-10-27T12:22:46Z", "черный", "0", 4, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "232": ["Качественные замки. Прочные, пока держатся. Ребёнок открыть не может.", "2020-10-27T09:56:44Z", "коричневый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "233": ["Я не знаю какой суперсилой нужно обладать, чтобы отрегулировать длину, даже у мужа не получилось, открываются с трудом, до этого покупала другой фирмы, был восторг, заказала эту и получила полное разочарование, ужасные и не удобные в использовании", "2020-10-27T05:30:29Z", "черный", "0", 0, 3, 2, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "234": ["Хорошо крепятся и держат", "2020-10-26T14:41:40Z", "коричневый", "0", 2, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "235": ["Очень хорошие замки! Крепятся надежно.", "2020-10-26T13:44:22Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "236": ["Пока довольны! Держится крепко! Неделю в использовании, дочка не может оторвать или открыть. Надеюсь, надолго хватит. И смотрится лаконично.", "2020-10-26T08:08:15Z", "белый", "0", 5, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "237": ["Отличные держатели. Ребёнок открыть не может", "2020-10-25T20:07:50Z", "черный", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "238": ["Из 6 штук у одной защёлки не приклеился один из концов, а другую сорвали резко дёрнув, хотя приклеивали оьезжирив поверхность. Видимо, на дереве не очень хорошее сцепление получается", "2020-10-05T18:37:32Z", "коричневый", "0", 5, 1, 4, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "240": ["Я каждый день благодарю человека, который сделал эти блокираторы. У кого ооочень активный ребёнок меня поймёт. Единственные, которые не смог открыть мой ребёнок. Очень крепкие. Рекомендую!!", "2020-10-23T20:59:34Z", "коричневый", "0", 4, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "241": ["Классные блокираторы,особенно на коричневую мебель хорошо коричневый цвет, не видно практически и не привлекает внимание ребёнка", "2020-10-22T08:07:08Z", "коричневый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "242": ["Самые лучшие блокираторы! Ребёнок 10 месяцев, висит на них иногда даже, все держится. Пробовали разные, все отваливаются рано или поздно. Здесь инструкция очень подробная. Месяца два висят, все супер! Заказала ещё бабушке в квартиру, чтобы без проблем в гости ходить. И цена ниже, что у других! Советую 👍🏼", "2020-10-20T21:42:56Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "243": ["Приклеились хорошо, как будут держаться посмотрим", "2020-10-20T17:34:26Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "244": ["Хорошие блокираторы, сегодня поставили выглядит довольно надёжно, главное чтобы клей был прочным)", "2020-10-19T17:47:17Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "245": ["Блокираторы отличные👍👍 только дороговато выходит( но что поделать, спокойствие и порядок дороже ", "2020-10-19T14:55:24Z", "коричневый", "0", 3, 1, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "246": ["Отличный блокиратор, заказала одну упаковку на пробу - очень довольно. Сейчас заказала ещё.", "2020-10-19T07:00:48Z", "коричневый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "247": ["Неудобно открывать", "2020-10-18T08:49:18Z", "белый", "0", 2, 3, 2, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "248": ["Соответствует описанию", "2020-10-17T17:27:38Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "249": ["Отличные! Спасибо. ", "2020-10-16T13:52:08Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "250": ["Сама упаковка была вскрыта. Сверху пакет валдберис заклеен, поэтому сразу не увидела, что упаковка вскрыта. Изначально очень расстроилась, что упаковка вскрыта, но решила все же попробовать.  Приклеиваются намертво. Даже я не могу открыть шкафчики, не то что ребёнок! Очень хорошие. Замочек крепкий, легко открывается. Действительно свою функцию выполняют! Из-за вскрытой упаковки 4 звезды. ", "2020-10-16T10:13:34Z", "белый", "0", 3, 0, 4, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "251": ["Отлично....", "2020-10-15T22:37:06Z", "коричневый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "252": ["Отлично работают, ребёнок открыть пока не смог.", "2020-10-14T19:43:24Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "253": ["Отличная покупка", "2020-10-14T03:40:49Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "254": ["Хорошие замки, держат, открыть ребёнку очень сложно будет.", "2020-10-13T06:54:13Z", "белый", "0", 3, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "255": ["Отличные блокираторы, ребёнок точно не поймет как их открыть.\nОчень гармонично смотрятся на мебели. \nТолько вот пришли во вскрытой упаковке, меня это не смутило, т.к. качество и комплектация в полном порядке, просто интересно, зачем человек заказавший данный товар до меня его вскрыл, убеделся что всё хорошо с блокираторами и вернул...\nУважаемые покупатели, давайте уважать друг друга и не вскрывать товар без надобности!", "2020-10-12T20:32:37Z", "белый", "0", 5, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "256": ["Получила сегодня свой заказ, счастью нет предела😂Холодильник, печка, шкафы все закрыла! Даже на дверь в одну комнату приклеяла. Посмотрим как будут держать,сыну 3,5 пока не понял механизм,надеюсь ещё долго не поймёт, сама не сразу открыла.😄Позже дополню отзыв😉", "2020-10-12T11:05:11Z", "белый", "0", 4, 0, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "257": ["Классные штучки!", "2020-10-09T17:06:54Z", "белый", "0", 3, 1, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "258": ["Самые лучшие, цена - качество 👍👍👍", "2020-10-09T09:55:03Z", "белый", "0", 3, 1, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "259": ["Начиталась отзывов, заказала((( да,сам замок ребенок открыть не может. Но они фиксируются на двухсторонний скотч, и когда ребенок пытается открыть дверцу шкафчика, замок просто отваливается. Вот так((((", "2020-10-06T20:56:26Z", "белый", "0", 7, 4, 2, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "260": ["Замки надежные, держатся прочно, механизм замка продуманный - малыши не справятся. ", "2020-10-06T19:37:11Z", "белый", "0", 3, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "261": ["Вчера наклеила блокираторы, пока все хорошо, сынок не может открыть. Да я и сама теперь лишний раз не подхожу к шкафам, так как пока ещё не привыкла к этой сложности замка 😄 заказала в чёрном цвете на шкаф-купе и камод. До этого у нас были обычные фирмы Пома и canpol babies, оба оказались непрактичными, слабыми и ребёнок научился их открывать за месяц пользования, затем и вовсе где то сломались, где то отклеились.", "2020-10-06T10:21:13Z", "коричневый", "0", 5, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "262": ["Отлично держатся,ребенок открыть не может)", "2020-10-04T09:44:00Z", "белый", "0", 2, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "263": ["Хорошие блокираторы, ребенок пока что не понял как открывать, держатся крепко. Посмотрим, как будет дальше. Снимаю звезду, за то, что пришли в рваной упаковке.", "2020-10-02T22:51:04Z", "белый", "0", 3, 1, 4, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "264": ["Замки отличные,ребенок неделю крутил вертел,пока не открыл,но доставка мягко говоря подкачала.Ждала практически месяц,писала претензии,у них одна шаблонная отписка(вы можете сделать возрат)заказывать товары желание пропало.(((", "2020-09-29T08:11:20Z", "черный", "0", 7, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "265": ["Очень хорошие замки. С первым ребёнком много разных пробовали. Открывала со временем, потому что растягивались. Очень удобные и в открывании и в закрывании. И вид не портят вовсе. Ребёнку 1,3. Открыть не может. Держатся отлично. Не отклеиваются. Жаль, что нет пока в наличии. Буду заказывает ещё. ", "2020-09-22T11:37:52Z", "коричневый", "0", 3, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "267": ["Отличный замок! Держит очень крепко, удобно пользоваться", "2020-09-23T07:35:41Z", "белый", "0", 3, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "268": ["Отличные замки, держат хорошо.", "2020-09-19T09:41:12Z", "черный", "0", 3, 3, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "269": ["Классные! Замок надежный, ребёнок не откроет (очень хорошая пружина, - нужно приложить усилие что открыть), и главное не отклеиваются 👻 До этого брали HB и caprol,  их проще открыть и отклеиваются постоянно, купила tusunny из-за выгоды (6 штук за 700₽) и не прогадала", "2020-09-05T17:36:33Z", "белый", "0", 6, 5, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "271": ["Супер, брала многие эти лучше всех!", "2020-09-13T10:04:49Z", "белый", "0", 3, 2, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "272": ["Вроде бы хорошо держатся. Прошло три дня", "2020-09-12T12:16:26Z", "черный", "0", 3, 2, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "273": ["Пришли в полной комплектации. Есть инструкция на русском и английском. Упаковка почему-то была отклеяна. По функционалу дополню отзыв позже.", "2020-09-05T12:47:12Z", "коричневый", "0", 4, 2, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"], "275": ["Действительно, очень удобные замки. Легко открывать и закрывать одной рукой. Вначале только разобраться надо, куда что сдвигать.  Лучшее соотношение цены и качества. Купила попробовать, обязательно закажу ещё.", "2020-09-12T09:47:44Z", "белый", "0", 3, 2, 5, "Замок-блокиратор для защиты от детей, 6 шт.", "TUSUNNY"]}
